/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';
import bape from '../img/bape.jpg';
import {Helmet} from "react-helmet";


class Navbar extends React.Component{

    render(){
        return (
            <Helmet>
                <script src='navbarAnim.js'></script>
            
        <div id="navbar">
            <nav class=" navbar navbar-expand-lg navbar-dark " style={{backgroundColor:'black'}}>
                <a class="navbar-brand"><img src={bape} alt="Alex" title="Alex" width="50" height="50"/></a>
    
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                 </button>
    
                <div class="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul class="navbar-nav ml-auto">
    
    
                        <li class="nav-item">
                            <a class="nav-link" href="aboutme.html"><b>Chi Sono</b></a>
                            <a class="nav-link" href="contact.html"><b>Contatti</b></a>
                        </li>
                    </ul>
    
    
                </div>
            </nav>
        </div>
        </Helmet>
        );
    }
}

export default Navbar;
